summary: |
  Red Hat OpenShift Container Platform 3.10, which fixes several bugs and includes various enhancements, is now available.

  Red Hat OpenShift Container Platform is Red Hat's cloud computing Kubernetes application platform solution designed for on-premise or private cloud deployments.

  The OpenShift Container Platform 3.10 Release Notes provide information about new features, bug fixes, and known issues:

  https://docs.openshift.com/container-platform/3.10/release_notes/ocp_3_10_release_notes.html

  This advisory contains the RPM packages for this release. See the following
  advisory for the container images for this release:

  https://access.redhat.com/errata/RHBA-2018:1817
